import {Constants} from "../constants/authConstance"

export const WordsReducer = (words = [], action) => {
    switch (action.type) {
        case Constants.ADD_WORD:
            return words = [...words, action.payload]
        case Constants.LOAD_NOTE_BY_ID:
            return action.payload
        default:
            return words
    }
}
